:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Thomas Coldham and BEETHAM, Anne Palmer (Annie)
  JWILLIAMS, Guy Coldham and HOPE-LEWIS, Eileen
  VWILLIAMS, Joan Elfie and DILLON, Patrick Philip Lee
  IDILLON, Rachel Anne and SAVORY, Robert
  DILLON, Rachel Anne and SAVORY, Robert (cont...)
  They moved to Bengeo Hall in 1982. It is a large, ten bedroom mansion on the outskirts of Hertford with
  3 acres of garden and 6 acres of field where Helen runs a guest house. She is a councillor on the
  Hertford Town Council and active in the European Union of Women, Lady Tavener's Freedom Assn, the New
  Zealand Assn and the Conservative Party.
  Robert is a paper broker, agent, merchant and managing director of Savory Paper.
  01> SAVORY, Charlotte Catherine Anne
  b 29.09.1968
  Charlotte b. in Hertfordshire, England. She is an interior designer.
  02> SAVORY, Victoria Lucy Lee
  b 22.06.1970
  Victoria b. in Hertfordshire, England. She is in her third year at Newcastle Polytech
  03> SAVORY, Josephine Elizabeth
  b 12.04.1972
  Josephine b. in Hertfordshire, England. She is in her second year at college in Cambridge.
  02> DILLON, Joanna Lee m on 03.04.1963 to CAMERON, David
  b 27.05.1941
  b 12.11.1937
  Joanna b. at Blenheim and m. at "Leefield", Blenheim. David, slo Clifford Charles Cameron and Hilda
  Rahr, b. in Kent, England. Address: "Waituna", PO Box 7, Waikari, North Canterbury.
  Joanna was educated at Selwyn House, Chilton Saint James and Craighead. David was educated at Stowe
  School, England then went into the Irish Guards for three years. They lived in Eire for 912 years before
  coming to New Zealand in 1972. David now farms on "Waituna" and they run the "Waituna" homestead as a
  bed and breakfast establishment. Joanna was Ladies' Captain of the Hawarden Golf Club in 1981-84 and
  Club President in 1987-88.
  01> CAMERON, Nicola Jane m on 15.01.1994 to DAVIE, Andrew Robert
  b 10.10.1965
  b ** ** ****
  Nicola b. at Drogheda, Eire. Address: 106 Creswick Terrace, Northland, Wellington.
  Nicola was educated at Selwyn House, Craighead and Canterbury University (BA in History). She
  started her own fashion business and won Young Designer of the Year at the Benson & Hedges Fashion
  Awards in 1989. She is now working for WE Spalding in Wellington.
  Andrew is a lawyer in Wellington.
  02> CAMERON, Timothy Charles m on 09.12.1995 to MCKEAN, Jo-Ann Mirielle
  b 27.04.1967
  b 26.10.1967
  Timothy b. at Drogheda, Eire. Jo-Ann b. at Auckland. Address: The Cottage, "Waituna", Waikari,
  North Canterbury.
  Timothy was educated at Waihi School and Christ's College. He was in the 1st rugby XV (4 years),
  1st cricket XI and represented the school at athletics (5 years). He played rugby for Canterbury
  County Colts in 1987. He is now manager of "Waituna".
  Jo-Ann was educated at Christchurch Girls' High School and Otago University.
  01> CAMERON, Archibald William David
  b 19.05.1997
  Archibald b. at Christchurch.
